import React from "react"
import musicNote from "../../Assets/musicNote.svg"

function MusicNote() {
  return(
    <img alt="Music Note" src={musicNote} style={{position: "absolute", left: "20px", bottom: "20px"}} />  
  )
}


export default MusicNote;
